import ExpenseItem from './ExpenseItem'
import 'ExpenseList.css';

function ExpenseList(props) {
    let displayContent = <p>No Expenses to Display</p>;

    if(props.item.length > 0) {
        displayContent = expenseToDisplay.map((expense) => ( 
            <ExpenseItem 
                key={expense.id}
                title={expense.title}
                amount={expense.amount}
                date={expense.date}
            />
        ));
    }
}
